          margin-right: 5vw;
          margin-top: 2vh;
          margin-left: 0;
          margin-bottom: 0;
          height: 20vh;
          display: inline-block;
          overflow: hidden;
          border-radius: 20px;
        }

        .session:hover {
          background: #EDD4B2;
        }

        h1 {
          font-family: "Montserrat", sans-serif;
          font-size: 150%;
          margin-left: 4vw;
        }

      `}</style>

    </div>
